import React, { Component, Fragment } from 'react';
import axios from 'axios';
import Pusher from 'pusher-js';
import Layout from '../components/Layout';

class IndexPage extends Component {

  render() {
    return (
      <Layout pageTitle="Realtime Data Visualization">
        <body className="container-fluid h-100 bg-light">
          <div className="col w-50 h-100">
            hello
          </div>
          <div className="col w-5 h-100">hi</div>
          <div className="row w-5 h-100">hi</div>
          <div className="row w-5 h-100">hi</div>
        </body>
      </Layout>
    );
  }

}

export default () => (
  <Fragment>
    <IndexPage />
  </Fragment>
);
